import React from 'react';
import './component.css'

const Navbar = () =>{


    return(
        <div class="navbar">
        <span className="navbarpt1">
        In Your Soul
        <a className="Nav_a 1" href="#">HOME</a>
        <a className="Nav_a 2" href="#">ABOUT</a>
        <a className="Nav_a 3" href="#">OFFERINGS</a>
        <a className="Nav_a 4" href="#">SELLING</a>
        </span> 
        <span className="navbarpt2">
        <button className="navButton">BOOK APPOINTMENT</button>
        </span> 

         </div>
    )
}

export default Navbar;
